<!DOCTYPE html>
<html>
  <head>
    <title>FontAwesome</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/fontawesome/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="resources/scripts/prototypePre.js"></script>
    <script src="data/document.js"></script>
    <script src="resources/scripts/prototypePost.js"></script>
    <script src="files/fontawesome/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- Unnamed (Rectangle) -->
      <div id="u0" class="ax_default box_1">
        <img id="u0_img" class="img " src="images/fontawesome/u0.png"/>
        <!-- Unnamed () -->
        <div id="u1" class="text" style="display:none; visibility: hidden">
          <p><span></span></p>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u2" class="ax_default label">
        <img id="u2_img" class="img " src="images/fontawesome/u2.png"/>
        <!-- Unnamed () -->
        <div id="u3" class="text">
          <p><span>搜索</span></p>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u4" class="ax_default label selected" selectiongroup="search_field">
        <img id="u4_img" class="img " src="images/fontawesome/u4_selected.png"/>
        <!-- Unnamed () -->
        <div id="u5" class="text">
          <p><span>宝贝</span></p>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u6" class="ax_default label" selectiongroup="search_field">
        <img id="u6_img" class="img " src="images/fontawesome/u4.png"/>
        <!-- Unnamed () -->
        <div id="u7" class="text">
          <p><span>天猫</span></p>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u8" class="ax_default label" selectiongroup="search_field">
        <img id="u8_img" class="img " src="images/fontawesome/u4.png"/>
        <!-- Unnamed () -->
        <div id="u9" class="text">
          <p><span>店铺</span></p>
        </div>
      </div>

      <!-- search_dianpu (Text Field) -->
      <div id="u10" class="ax_default serch_text_field" data-label="search_dianpu">
        <input id="u10_input" type="search" value=""/>
      </div>

      <!-- search_tianmao (Text Field) -->
      <div id="u11" class="ax_default serch_text_field ax_default_hidden" data-label="search_tianmao" style="display:none; visibility: hidden">
        <input id="u11_input" type="search" value=""/>
      </div>

      <!-- search_baobei (Text Field) -->
      <div id="u12" class="ax_default serch_text_field" data-label="search_baobei">
        <input id="u12_input" type="search" value=""/>
      </div>
    </div>
  </body>
</html>
